        'The world lies in peril. Decades ago, a band of legendary warriors slayed the dreaded Shadow Titan after a long and ferocious struggle, but their celebration was short-lived. The Shadow Titan’s true intentions revealed themselves when from his broken husk flowed the Blight; a corrupting fog that alters any living creature exposed to its evil.\tBlightbound is an ever-expanding game with new dungeons to explore, new heroes to recover and use, and new loot to retrieve with planned free updates for the community.\tCollect over 20 unique heroes, each with their own skill set, passive abilities, and fully narrated story to complete.\tHundreds of unique items to loot and craft to improve each hero and alter their repertoire of attacks and abilities. \tBuild out your refuge atop the mountain by recruiting new artisans to craft more items, fulfilling bounties, and training your heroes.\tBattle through three distinct lands, each with several dungeons to conquer, including the eerie Gravemark, the oppressive Underhold, and precarious Blood Ridge.\tDistinct class roles that reward team play and powerful ultimate abilities that charge from fulfilling your role. Block damage as a warrior, interrupt enemies as an assassin or heal your allies as a mage.\tA stunning mix of hand-painted characters and real time 3D models and lighting effects.',
